import { useState } from 'react';
import Nav from 'react-bootstrap/Nav';
import './top_nav.css';

function PillsExample() {
  const [selectedTab, setSelectedTab] = useState('new'); // Initialize selectedTab state

  // Function to handle tab selection
  const handleTabSelect = (eventKey) => {
    setSelectedTab(eventKey);
  };

  // Function to render appointments based on selected tab
  const renderAppointments = () => {
    // Logic to determine which appointments to display based on selectedTab
    switch (selectedTab) {
      case 'new':
        return <div>New Appointments</div>;
      case 'suggested':
        return (
          <div className="appointment-details">
            <div>Suggested Appointments</div>
            {/* Display the details related to the suggested appointments */}
          </div>
        );
      case 'confirmed':
        return <div>Confirmed Appointments</div>;
      case 'canceled':
        return <div>Canceled Appointments</div>;
      case 'past':
        return <div>Past Appointments</div>;
      default:
        return null;
    }
  };

  return (
    <>
      <Nav variant="pills" defaultActiveKey="new" className="custom-nav">
        <Nav.Item>
          <Nav.Link
            eventKey="new"
            onSelect={handleTabSelect}
            className={selectedTab === 'new' ? 'active' : ''}
          >
            New Appointments
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link
            eventKey="suggested"
            onSelect={handleTabSelect}
            className={selectedTab === 'suggested' ? 'active' : ''}
          >
            Suggested Appointments
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link
            eventKey="confirmed"
            onSelect={handleTabSelect}
            className={selectedTab === 'confirmed' ? 'active' : ''}
          >
            Confirmed Appointments
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link
            eventKey="canceled"
            onSelect={handleTabSelect}
            className={selectedTab === 'canceled' ? 'active' : ''}
          >
            Canceled Appointments
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link
            eventKey="past"
            onSelect={handleTabSelect}
            className={selectedTab === 'past' ? 'active' : ''}
          >
            Past Appointments
          </Nav.Link>
        </Nav.Item>
      </Nav>
      {renderAppointments()} {/* Render appointments based on selected tab */}
    </>
  );
}

export default PillsExample;
